var _wwPluginInstance = 1;
CKEDITOR.plugins.add('warpwirecontentitem', {
	requires: ['iframedialog'],
	lang: ['en'],

	// The plugin initialization logic goes inside this method.
	init: function(editor) {
		var _wwInstance = _wwPluginInstance;
		_wwPluginInstance++;
		// NOTE: enter URL of your Warpwire instance (if empty, students will not be able to contribute)
		var studentContributionUri = '';

		var pluginVersion = '3.0.3';
		var pluginEditor = this;
		var attachedEvents = [];
		var ContentItemIFrameWindow = null;

		// list of state detection variables
		var siteMaintainerText = 'must be site maintainer';

		// a local instance of the plugin editor
		var pluginEditor = this;
		// set height and width of iframe dialog
		var height = 480,
			width = 750;

		// Sakai ContentItem is not properly setup
		if(
			(typeof(sakai) == 'undefined') || (typeof(sakai.editor) == 'undefined') || 
			(typeof(sakai.editor.contentItemUrl) == 'undefined') || (sakai.editor.contentItemUrl.length <= 0)
		) {
			CKEDITOR.dialog.addIframe(
				'WarpwireContentItemDialog_'+_wwInstance,
				'Select Content Item',
				CKEDITOR.plugins.externals.warpwirecontentitem.dir + 'index.html', width, height,
				function() {
					var self = this;
					// load the associated iframe launch context
					try {
						var iframe = document.getElementById(self._.frameId);
						var iframeBody = iframe.contentWindow.document.getElementsByTagName('body')[0];
						iframeBody.innerHTML = '';
						iframeBody.appendChild(renderMessage('no_content_item_url'));
						return(true);
					} catch(e) {}
				}
			);
			// the content item return url is set up
		} else {
			function loadFunction() {
				var self = this;

				var iframe = document.getElementById(self._.frameId);
				ContentItemIFrameWindow = iframe.contentWindow;

				// hide all of the dialog button on the editor chooser menu
				Object.keys(self._.dialog._.buttons).forEach(function(key) {
					try {
						self._.dialog._.buttons[key].getElement().hide();
					} catch(e) {}
				});

				try {
					// use the editor document link structure to launch the appropriate link
					var links = ContentItemIFrameWindow.document.getElementsByTagName('a');

					// this is the initial launch, load corresponding content information
					if(typeof(ContentItemIFrameWindow.returned_content_item) == 'undefined') {
						// navigate to the Warpwire tool if found
						var warpwireToolFound = false;
						var siteMaintainer = true;
						var iframeBody = ContentItemIFrameWindow.document.getElementsByTagName('body')[0];

						// iterate over content item tool links, and click on Warpwire tool link if found
						for(var i = 0; i < links.length; i++) {
							if(links[i].textContent.toLowerCase() == 'warpwire') {
								links[i].click();
								iframeBody.innerHTML = '';
								// reset the visibility, to show the dialog
								self._.dialog.getElement().getFirst().setStyle('visibility', 'visible');
								warpwireToolFound = true;
								return(false);
							}
						}
						// detect if the user is not a site maintainer						
						if(
							iframeBody &&
							iframeBody.innerText &&
							iframeBody.innerText.toLowerCase().indexOf(siteMaintainerText.toLowerCase()) !== -1
						) {
							siteMaintainer = false;
						}
						// the user is not a site maintainer
						if((!warpwireToolFound) && (!siteMaintainer)) {
							// there is no contribution uri defined for students
							if(
								(!studentContributionUri) ||
								(studentContributionUri == null) ||
								(studentContributionUri.trim().length <= 0)) {
								iframeBody.innerHTML = '';
								iframeBody.appendChild(renderMessage('not_site_maintainer'));
								// reset the visibility, to show the dialog
								self._.dialog.getElement().getFirst().setStyle('visibility', 'visible');
								return(true);
							}

							// extract the group information from the Sakai URL
							var sakaiSiteUri = top.document.URL;
							var sakaiUniqueId = '';

							// extract the unique id from the site URI
							if(sakaiSiteUri.indexOf('/site/') > 0) {
								sakaiUniqueId = sakaiSiteUri.split('/site/')[1].split('/')[0];
							}

							// create a random string to authorize this domain for access
							if(pluginEditor.pluginId == null) {
								pluginEditor.pluginId = '';
								for(var i = 0; i < 32; i++) {
									pluginEditor.pluginId += Math.floor(Math.random() * 16).toString(16);
								}
							}

							// get the local path for this editor
							var localEditorPath = pluginEditor.path.replace('/(\/)+$/g', '');
							editorPath = window.location.origin + localEditorPath.replace(window.location.origin, '');
							
							// ensure that a protocol is associated with the url
							if (studentContributionUri.indexOf('https://') === -1) {
								studentContributionUri = 'https://' + studentContributionUri;
							}
							
							// build the complete editor path
							editorPath = studentContributionUri.replace(/\/$/g, '') +
								'/p/checkGroup/?uniqueId=' + sakaiUniqueId +
								'&externalContext=sakai_' + this.pluginVersion +
								'&pluginLaunchReturnUrl=' +
								encodeURIComponent(editorPath + '/html/warpwire.html') +
								'&pluginId=' + pluginEditor.pluginId;

							// launch the content of the panel window this frame context
							iframeBody.innerHTML = '';

							// attach an event to listen to the post message
							addLocalEvent(window, 'message', function(e) {
								// the plugin did not return an authorized token
								if((e.origin !== location.origin) || (e.data.pluginId != pluginEditor.pluginId)) {
									console.log('Security context validation failed');
									return(false);
								}

								// get the event package
								if((e.data.message === 'deliverResult') && (e.data.result)) {
									// get the Warpwire asset information
									try {
										var assets = JSON.parse(e.data.result);
										for(var i = 0; i < assets.length; i++) {
											// create a new CKEditor iframe node
											var iframeNode = new CKEDITOR.dom.element('span');
											var localSrc = '';
											var localImage = '';
											var localWidth = 90;
											var localHeight = 90;
											var localTitle = '';

											for(var prop in assets[i].iframe) {
												var tempFrameData = assets[i].iframe;
												if(prop == '_ww_src') {
													// the url must always be over TLS
													tempFrameData[prop] = tempFrameData[prop].replace('http://', 'https://');
												}
												if((prop == '_ww_width') && (parseInt(tempFrameData[prop]) > 0)) {
													localWidth = tempFrameData[prop];
												}
												if((prop == '_ww_height') && (parseInt(tempFrameData[prop]) > 0)) {
													localHeight = tempFrameData[prop];
												}
											}

											if((assets[i].assetData != null) && (assets[i].assetData['title'] != null)) {
												localTitle = assets[i].assetData['title'];
											}

											if(assets[i]._ww_img != null) {
												localImage = assets[i]._ww_img;
											}

											// build the iframe node and attach to the element
											iframeNode.setAttribute('class', '_ww_iframe_embed');
											iframeNode.setAttribute('rel', JSON.stringify(assets[i].iframe));
											iframeImage = new CKEDITOR.dom.element('img');
											iframeImage.setAttribute('alt', localTitle);
											iframeImage.setAttribute('width', localWidth);
											iframeImage.setAttribute('height', localHeight);
											iframeImage.setAttribute('class', '_ww_img');
											iframeImage.setAttribute('src', localImage.replace("http://", "https://"));
											// add the image to the span
											iframeNode.append(iframeImage);
											if(editor.mode == 'wysiwyg') {
												editor.insertElement(iframeNode);
											}
										}
										e.data.message = '';
									} catch(e) {
										console.log('Unable to parse data due to: ' + e);
									}

									// clear the contents of the frame
									iframe.src = 'about:blank;';
									iframeBody.innerHTML = '';

									// close the CKEditor window
									self._.dialog._.buttons['ok'].click();

									// remove the event listener
									removeLocalEvent(window, 'message', function(e) {});
								}
							});

							// replace the URI context completely with the older plugin context
							iframe.src = editorPath;
							self._.dialog.getElement().getFirst().setStyle('visibility', 'visible');

							// register an event listen to receive the message
							var onSameDomain = false;
							var pluginCheckInterval = setInterval(function() {
								// the html of the document can be parsed
								var parseHtml = null;
								try {
									// allows for universal context detection
									var localDoc = iframe.contentDocument || iframe.contentWindow.document;
									parseHtml = doc.body.innerHTML;
									if(parseHtml != null) {
										onSameDomain = true;
									}

									// ask for the iframes document results
									if(onSameDomain) {
										clearInterval(pluginCheckInterval);
										iframe.document.postMessage({
											message: "requestResult"
										}, "*");
									}
								} catch(e) {
									// the iframe was closed
									if(iframe.closed) {
										clearInterval(pluginCheckInterval);
										return(true);
									}
								}

							}, 500);

							return(true);
						}
						// Warpwire tool is not found - alert the user to this fact
						else if(!warpwireToolFound) {
							iframeBody.innerHTML = '';
							iframeBody.appendChild(renderMessage('no_warpwire_tool'));
							// reset the visibility, to show the dialog
							self._.dialog.getElement().getFirst().setStyle('visibility', 'visible');
							return(true);
						}

						// reset the visibility, to show the dialog - this fallthrough will only happen if the Warpwire tool
						// is found, but is somehow not clicked
						self._.dialog.getElement().getFirst().setStyle('visibility', 'visible');
						// there are no returned content items - short circuit
						return(false);
					} else {
						// we have returned content items - click the 'OK' button
						try {
							self._.dialog._.buttons['ok'].click();
							return(true);
						} catch(e) {}
					}
				} catch(e) {
					console.log('Unhandled exception: '+e);
				}

				try {
					// reset the visibility, to show the dialog if there has been a fallthrough
					self._.dialog.getElement().getFirst().setStyle('visibility', 'visible');
				} catch(e) {}
			}

			// set up the iframe loader
			CKEDITOR.dialog.addIframe(
				'WarpwireContentItemDialog_'+_wwInstance,
				'Select Content Item',
				sakai.editor.contentItemUrl, width, height,
				loadFunction, {
					// onShow callback - used to set the visibility of the container to hidden on initial load, so that there is no
					// UI flashing
					onShow: function() {
						var self = this;
						try {
							self.getElement().getFirst().setStyle('visibility', 'hidden');
						} catch(e) {}
					},

					// onOk callback, used to parse and insert returned content item data
					onOk: function() {
						// get the returned content item information from the iframe window
						var items = ContentItemIFrameWindow.returned_content_item;
						// iterate through the returned items
						if(items) {
							for(var i = 0; i < items.length; i++) {
								var item = items[i];
								// the type operator is not defined
								if(!item.hasOwnProperty('@type')) {
									continue;
								}
								try {
									if(item['@type'] == 'LtiLinkItem') {
										var placementContainer = new CKEDITOR.dom.element('span');
										// set the content item placement attributes to mirror the targets
										placementContainer.setAttribute('rel', item.launch.replace('http://', 'https://'));
										placementContainer.setAttribute('class', '_ww_iframe_embed');
										placementContainer.setAttribute('style', 'width: 640px; height: 360px;');

										if(
											(typeof(item.placementAdvice) == 'undefined') || (typeof(item.placementAdvice.presentationDocumentTarget) == 'undefined') || (item.placementAdvice.presentationDocumentTarget != 'iframe')
										) {
											var placementLink = new CKEDITOR.dom.element('a');
											placementLink.setAttribute('href', item.launch.replace('http://', 'https://'));
											placementLink.setAttribute('class', 'lti-content-item-launch');
											placementLink.setText(item.title);
											placementContainer.append(placementLink);
										} else {
											var placementLink = new CKEDITOR.dom.element('img');
											placementLink.setAttribute('class', 'lti-content-item-iframe-launch');

											if(item.placementAdvice.hasOwnProperty('displayWidth')) {
												placementLink.setAttribute('width', item.placementAdvice.displayWidth);
											}

											if(item.placementAdvice.hasOwnProperty('displayHeight')) {
												placementLink.setAttribute('height', item.placementAdvice.displayHeight);
											}

											if(item.icon.hasOwnProperty('@id')) {
												placementLink.setAttribute('src', item.icon['@id']);
											}

											// set the alt tag to the launch url
											if(item.hasOwnProperty('launch')) {
												placementLink.setAttribute('alt', item.launch.replace('http://', 'https://'));
											}

											// set the alt tag to the title if applicable
											if(item.hasOwnProperty('title')) {
												placementLink.setAttribute('alt', item.title);
											}

											// append the new image container
											placementContainer.append(placementLink);
										}
										editor.focus();
										editor.insertElement(placementContainer);
									} else if(item['@type'] == 'ContentItem') {
										// create a link element
										var placementLink = new CKEDITOR.dom.element('a');
										placementLink.setAttribute('href', item.url);
										placementLink.setAttribute('target', '_blank');
										placementLink.setAttribute('class', 'lti-contentitem');
										placementLink.setText(item.title);

										// insert the link into the editor
										editor.insertElement(placementLink);
									} else if((item['@type'] == 'FileItem') && (item['mediaType'].startsWith('image/'))) {
										// create an image element
										var placementImage = new CKEDITOR.dom.element('img');
										placementImage.setAttribute('src', item.url);
										placementImage.setAttribute('class', 'lti-image');
										placementImage.setAttribute('alt', item.title);

										// insert the image into the editor
										editor.insertElement(placementImage);
									} else {
										console.log('Not handled: ' + item['@type']);
									}
								} catch(e) {
									console.log('Unhandled Content Item Exception: ' + e);
									console.log(e.stack);
								}
							}
						}
					}
				}
			);
		}

		editor.addCommand('WarpwireContentItemDialog_'+_wwInstance, new CKEDITOR.dialogCommand('WarpwireContentItemDialog_'+_wwInstance));

		// Create a toolbar button that executes the plugin command.
		// http://docs.cksource.com/ckeditor_api/symbols/CKEDITOR.ui.html#addButton
		editor.ui.addButton('WarpwireContentItem', {
			// Toolbar button tooltip.
			label: 'Insert Warpwire Media',
			// Reference to the plugin command name.
			command: 'WarpwireContentItemDialog_'+_wwInstance,
			// Button's icon file path.
			icon: this.path + 'images/warpwirecontentitem.png'
		});

		// safely attaches an event to the DOM
		function addLocalEvent(element, event, fn, bubble) {
			if(attachedEvents[element + '.' + event] == true) {
				return(true);
			}

			if('addEventListener' in element) {
				try {
					element.addEventListener(event, fn, bubble);
					attachedEvents[element + '.' + event] = true;
				}
				// unable to attach the event listener, the event can be attached locally
				catch(e) {
					if((typeof fn == 'object') && (fn.handleEvent)) {
						element.addEventListener(event, function(e) {
							fn.handleEvent.call(fn, e);
						}, bubble);
					} else {
						throw $e;
					}
				}
			} else if('attachEvent' in element) {
				// callback can handle the event properly
				if((typeof fn == 'object') && (fn.handleEvent)) {
					element.attachEvent('on' + event, function() {
						fn.handleEvent.call(fn);
						attachedEvents[element + '.' + event] = true;
					});
				} else {
					element.attachEvent('on' + event, fn);
					attachedEvents[element + '.' + event] = true;
				}
			}
		}

		// safely removes an event to the DOM
		function removeLocalEvent(element, event, fn, bubble) {
			if('removeEventListener' in element) {
				try {
					element.removeEventListener(event, fn, bubble);
					attachedEvents[element + '.' + event] = false;
				}
				// unable to attach the event listener, the event can be attached locally
				catch(e) {
					if((typeof fn == 'object') && (fn.handleEvent)) {
						element.removeEventListener(event, function(e) {
							fn.handleEvent.call(fn, e);
							attachedEvents[element + '.' + event] = false;
						}, bubble);
					} else {
						throw $e;
					}
				}
			} else if('detachEvent' in element) {
				// callback can handle the event properly
				if((typeof fn == 'object') && (fn.handleEvent)) {
					element.detachEvent('on' + event, function() {
						fn.handleEvent.call(fn);
						attachedEvents[element + '.' + event] = fale;
					});
				} else {
					element.detachEvent('on' + event, fn);
					attachedEvents[element + '.' + event] = false;
				}
			}
		}

		function renderMessage(message_id) {
			// static message lookup table
			var messageObject = {
				'no_content_item_url': 'The ContentItem App Store is not properly setup. Please contact your Sakai Administrator.',
				'no_warpwire_tool': '<!--No Warpwire tool installed / installed incorrectly Messaging--><p style="color: red;">Error: The Warpwire tool is either not installed or configured incorrectly. Please contact your Sakai Administrator.</p><!--hide and unfold content below--><p style="margin-top: 60px;">If you are the Sakai administrator, use the following steps to verify Warpwire plugin installation and configuration.</p><p style="margin-top: 60px;">First, navigate to the "Administration Workspace" under the sites dropdown:</p><img style="border: solid 1px #000;" src="' + getWWImage('sakai-admin') + '" /><p style="margin-top: 60px;">Second, click on "External Tools" in the left column navigation:</p><img style="border: solid 1px #000;" src="' + getWWImage('sakai-tool') + '" /><p style="margin-top: 60px;">Third, check that Warpwire is installed. It should look like the below screenshot:</p><img style="width: 600px; border: solid 1px #000;" src="' + getWWImage('sakai-universal') + '" /><p style="margin-top: 60px;">Fourth, if the plugin is not installed, click the "Install LTI 1.1 Tool" text link on the right side of the frame.</p><p style="margin-top: 60px;">Finally, either install from scratch with the following configuration, or use the table below to verify the configuration is correct:</p><img style="border: solid 1px #000;" src="' + getWWImage('sakai-external') + '" /><style>td { border: solid 1px #ddd; padding: 5px; vertical-align: top; }</style><table cellpadding="0" cellspacing="0" style="border: solid 1px #ddd; margin-top: 60px; width: 600px;"><tr><td style="font-weight: bold; background: #eee;">Option</td><td style="font-weight: bold; background: #eee;">Setting</td></tr><tr><td>Site Id</td><td>Leave Blank</td></tr><tr><td>Tool Title</td><td>Warpwire</td></tr><tr><td>Allow tool title to be changed</td><td>allow</td></tr><tr><td>Button Text (text in tool menu)</td><td>Warpwire</td></tr><tr><td>Allow button text to be changed</td><td>do not allow</td></tr><tr><td>Tool Status</td><td>enabled</td></tr><tr><td>Tool Visibility</td><td>visible</td></tr><tr><td>Launch URL</td><td>your institution\'s warpwire launch url</td></tr><tr><td>Allow Launch URL to be changed</td><td>allow</td></tr><tr><td>Launch Key</td><td>your launch key, provided by Warpwire</td></tr><tr><td>Allow Launch Key to be changed</td><td>do not allow</td></tr><tr><td>Launch Secret</td><td>your launch secret, provided by Warpwire</td></tr><tr><td>Allow launch secret to be changed</td><td>do not allow</td></tr><tr><td>Height</td><td>you choose, recommended 800px+</td></tr><tr><td>Allow height to be changed</td><td>do not allow</td></tr><tr><td>Configuration dialog when tool is selected</td><td>bypass configuration dialog</td></tr><tr><td>Privacy Settings</td><td><p>Check:</p><ul><li>"send user names to external tool"</li><li>"send email addresses to external tool"</li></ul></td></tr><tr><td>Services</td><td><p>Check all three:</p><ul><li>"allow external tool to return grades"</li><li>"provide roster to external tool" and</li><li>"allow external tool to store setting data"</li></ul></td></tr><tr><td>Indicate the following types of Content-Item Selection launches this tool can handle</td><td><p>Check the first three:</p><ul><li>"allow the tool to be launched as a link (this is typically true for most tools"</li><li>"allow external tool to configure itself (the tool must support the IMS content-item messag"</li><li>"allow the tool to be used from the rich content editor to select content (the tool must support the IMS content-item message"</li></ul></td></tr><tr><td>Launch in popup</td><td>never launch in popup</td></tr><tr><td>Debug launch</td><td>never launch in debug mode</td></tr><tr><td>Sha-256 signature support</td><td>sign launch with sha-256</td></tr><tr><td>lti 1.3 support</td><td>tool does not support lti 1.3</td></tr></table>',
				'not_site_maintainer': '<p style="color: red;">Error: The Warpwire tool is not configured to allow users who are not admins or site maintainers to add content. Please contact your Sakai Administrator to configure the Warpwire tool for universal contribution mode.</p>',
				'generic': 'There appears to be an issue with the Warpwire plugin. Please contact your support team and provide the following reference number: <code>GENERIC_ERROR_01</code>'
			};

			var messageWrapper = document.createElement('span');
			messageWrapper.style.cssText = 'margin: 0; font-family: Helvetica, sans-serif; font-weight: 300; font-size: 14px;';

			var messageHeader = document.createElement('span');
			messageHeader.style.cssText = 'padding: 15px;';
			var headerImageParagraph = document.createElement('p');
			var headerImage = document.createElement('img');
			headerImage.style.cssText = 'width: 175px; height: auto;';
			headerImage.src = getWWImage('logo');
			headerImageParagraph.appendChild(headerImage);
			messageHeader.appendChild(headerImageParagraph);
			messageWrapper.appendChild(messageHeader);

			var messageContent = document.createElement('span');
			messageContent.style.cssText = 'margin: 30px 15px;';
			var message = messageObject['generic'];
			if(typeof(messageObject[message_id]) != 'undefined')
				message = messageObject[message_id];
			messageContent.innerHTML = message;
			messageWrapper.appendChild(messageContent);

			return(messageWrapper);
		}

		function getWWImage(image) {
			if(image == 'logo') {
				return('data:image/png;base64,');
			} else if(image == 'sakai-admin') {
				return('data:image/jpeg;base64,');
			} else if(image == 'sakai-tool') {
				return('data:image/jpeg;base64,');
			} else if(image == 'sakai-universal') {
				return('data:image/jpeg;base64,');
			} else if(image == 'sakai-external') {
				return(' data:image/jpeg;base64,');
			}
		};
	},
});
